import React, { useEffect, useState } from "react";
import { baseUrl } from "../components";

// Import the CareerBox component if needed

const Mission = () => {
    const [jobOpening, seteJobOpening] = useState();
    const getId = async () => {
        let results = await fetch(`${baseUrl}/job`).then(resp => resp.json());
        seteJobOpening(results);
  
    }

    return (
        <>
            <p>{getId()}</p>
        </>
    );
};

export default Mission;
